import React from 'react';
import { IconButton } from '@mui/material';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import { useNavigate } from 'react-router-dom';
import WorkIcon from '@mui/icons-material/Work'; 
import ProjectIcon from '@mui/icons-material/Build'; 
import LandscapeOverlay from '../../components/LandscapeOverlay';

const Portfolio = () => {
  const navigate = useNavigate();

  const navigateToWorkExperience = () => {
    navigate('/WorkExperience');
  };

  const navigateToProjects = () => {
    navigate('/Projects');
  }

  const handleBack = () => {
    navigate(-1);
  };

  return (
    <div className="flex flex-col items-center justify-center min-h-screen min-w-full bg-transparent">
      <IconButton onClick={handleBack} className="absolute top-5 left-5 z-10">
        <ArrowBackIcon />
      </IconButton>
      <div className="flex justify-center space-x-2">
        <button onClick={navigateToWorkExperience} className="w-50 h-50 md:w-64 md:h-64 bg-white rounded-[20%] m-2 shadow-md flex flex-col items-center justify-center hover:shadow-lg transition duration-300">
          <WorkIcon className="text-6xl md:text-9xl" />
          <span className="mt-2 text-center text-lg md:text-xl">Work Experience</span>
        </button>
        <button onClick={navigateToProjects} className="w-50 h-50 md:w-64 md:h-64 bg-white rounded-[20%] m-2 shadow-md flex flex-col items-center justify-center hover:shadow-lg transition duration-300">
          <ProjectIcon className="text-6xl md:text-9xl" />
          <span className="mt-2 text-center text-lg md:text-xl">Projects</span>
        </button>
      </div>
      <LandscapeOverlay />
    </div>
  );
};

export default Portfolio;
